import Gallery from "../components/Gallery"

import fs from "fs";

export async function getStaticProps() {
  const files = fs.readdirSync(`${process.cwd()}/`);
  console.log(files)

  return {
    props: {
      files,
    },
  };
}

export default function Home({ posts }) {
  return (
    <Gallery posts={posts}/>
  );
}
